import React from'react';




class Video_thumb extends React.Component {
	render() {

		return (
			<div>
				<div class="row">
	  					<div class="col-12 col-md-8">.col-12 .col-md-8</div>
	 				 <div class="col-6 col-md-4">.col-6 .col-md-4</div>
				</div>
			</div>
		)
	}
}



export default Video_thumb;
